import React, {Component} from "react";
import "../styling/style.css"
import SignUp from "../components/signup";
import Navbar from "../components/navbar"


class Login extends Component {
    render() {
        return (

            <div className="container">
                <Navbar/>


                <div className="hero">
                    <div className="section-60-images"style={{width:"50%",height:"50%"}}>
                        <img src="../static/undraw_studying_s3l7.svg"/>

                    </div>

                    <div style={{height:"100vh"}}className="section-50-column">
                        <SignUp style={{height:"100vh",alignSelf: "center"}}/>
                    </div>
                </div>


            </div>
        )
    }

}


export default Login;
